import './App.css';

function App() {
  const navLocations = [
    "Home", "Menu", "Promotions",
  ];
  return (
    <div className="header-menu">
      {navLocations.map(name => 
        <a className="header-menu-item"><span label={name}>{name}</span></a>
      )}
    </div>
  );
}

